import React from 'react';

const VideoList = ({ videos }) => {
    const renderVideos = videos.map(video => {
        return <p>video.id</p>;
    });

    return (
        <div className='container'>
            <div className='row'>
                <div className='col'>
                    {renderVideos}
                </div>
            </div>
        </div>
    );
}

export default VideoList;
